export default function Review({bookreview}){
    const reviewList = (
        <div id="book-collection">{
            bookreview.map((review)=>{
             return <BookCard key={review.id} review={review}/>
            })
          }</div>
      )
    return(
        <div>
            {reviewList}
        </div>
    )
}
